import axios from 'axios'
import { transition } from '../../models/transition'

export const addTransition=(transition:transition)=>{
return {
    type:"TRANSITIONADD",
    payloud:transition
}
}
export const deleteAll=()  =>{
    return{
     type:"DELETEALL",
     payload:null
    }
}
export const deleteAllTransition = () => {
    return (dispatch: (arg0: any) => void) => {
    axios.get(`https://localhost:44330/api/transition/deleteAll`).then((succ) => {
          console.log("s deleteall");
            dispatch( deleteAll());
           
        }).catch((er) => {
          
            console.log(er.message)         
        })
    }
} 
export const deleteTransition=(name:string)=>{
    return {
        type:"TRANSITIONDELETE",
        payloud:name
    }
     }

     export const fillTransitiontoreducer=(transitions: transition[] )=> {
       return {
           type:"TRANSITIONFILL",
           payloud:transitions
       }
    }
    
     export const  getTransitions = () => {
        return (dispatch: (arg0: { type: string; payloud: transition[]; }) => void) => {
            axios.get(`https://localhost:44341/transitions/all`).then((succ) => {
                console.log([succ.data[0]]);
    
                dispatch(fillTransitiontoreducer([succ.data[0]]))
              
                // return succ.data.length;
            }).catch((er) => {
                console.log(er.message)
            })
        }
    }
